import React, { useState } from "react";
import {
  Box,
  Flex,
  Heading,
  Text,
  Progress,
  Card,
  CardBody,
  CardHeader,
  CardFooter,
  Icon,
  Modal,
  ModalOverlay,
  ModalContent,
  ModalHeader,
  ModalBody,
  ModalCloseButton,
  Button,
  Grid,
} from "@chakra-ui/react";
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from "recharts";
import { PhoneIcon, TimeIcon, UsersIcon } from "@chakra-ui/icons";

const ParticipantsPage = () => {
  const [isModalOpen, setModalOpen] = useState(false);

  const dailyCallData = [
    { day: "Mon", calls: 45, duration: 180, scheduled: 8, missed: 4 },
    { day: "Tue", calls: 52, duration: 195, scheduled: 10, missed: 3 },
    { day: "Wed", calls: 48, duration: 185, scheduled: 9, missed: 3 },
    { day: "Thu", calls: 55, duration: 210, scheduled: 12, missed: 2 },
    { day: "Fri", calls: 50, duration: 190, scheduled: 9, missed: 4 },
  ];

  return (
    <Box p={6} maxWidth="1200px" mx="auto">
      {/* Page Header */}
      <Flex justify="space-between" align="center" mb={8}>
        <Heading size="lg">Participants Dashboard</Heading>
        <Button colorScheme="blue" onClick={() => setModalOpen(true)}>
          View AI Details
        </Button>
      </Flex>

      {/* Metrics Section */}
      <Grid templateColumns={{ base: "repeat(1, 1fr)", md: "repeat(4, 1fr)" }} gap={6} mb={8}>
        <Card>
          <CardHeader>
            <Flex justify="space-between" align="center">
              <Heading size="sm">Subjects Recruited</Heading>
              <UsersIcon boxSize={5} />
            </Flex>
          </CardHeader>
          <CardBody>
            <Text fontSize="2xl" fontWeight="bold">
              90
            </Text>
            <Text fontSize="sm" color="gray.500">
              Target: 90
            </Text>
          </CardBody>
        </Card>

        <Card>
          <CardHeader>
            <Flex justify="space-between" align="center">
              <Heading size="sm">Today's Calls</Heading>
              <PhoneIcon boxSize={5} />
            </Flex>
          </CardHeader>
          <CardBody>
            <Text fontSize="2xl" fontWeight="bold">
              50
            </Text>
            <Text fontSize="sm" color="gray.500">
              92% connection rate
            </Text>
          </CardBody>
        </Card>

        <Card>
          <CardHeader>
            <Flex justify="space-between" align="center">
              <Heading size="sm">Upcoming Reminders</Heading>
              <TimeIcon boxSize={5} />
            </Flex>
          </CardHeader>
          <CardBody>
            <Text fontSize="2xl" fontWeight="bold">
              15
            </Text>
            <Text fontSize="sm" color="gray.500">
              Next 48 hours
            </Text>
          </CardBody>
        </Card>

        <Card>
          <CardHeader>
            <Flex justify="space-between" align="center">
              <Heading size="sm">Avg Call Duration</Heading>
              <Icon as={TimeIcon} boxSize={5} />
            </Flex>
          </CardHeader>
          <CardBody>
            <Text fontSize="2xl" fontWeight="bold">
              3m 45s
            </Text>
            <Text fontSize="sm" color="gray.500">
              Total: 16 hours
            </Text>
          </CardBody>
        </Card>
      </Grid>

      {/* Recruitment Progress Section */}
      <Card mb={8}>
        <CardHeader>
          <Heading size="md">Recruitment Progress</Heading>
        </CardHeader>
        <CardBody>
          <Flex justify="space-between" align="center" mb={2}>
            <Text>Current Progress: 90/90 subjects</Text>
            <Text fontWeight="bold">100%</Text>
          </Flex>
          <Progress value={100} size="sm" colorScheme="green" />
          <Text fontSize="sm" color="gray.500" mt={2}>
            Target achieved: Completed in 3.5 weeks
          </Text>
        </CardBody>
      </Card>

      {/* Daily Call Statistics Section */}
      <Card>
        <CardHeader>
          <Heading size="md">Daily Call Statistics</Heading>
        </CardHeader>
        <CardBody>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={dailyCallData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="day" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="calls" fill="#3182CE" name="Total Calls" />
              <Bar dataKey="scheduled" fill="#48BB78" name="Scheduled" />
              <Bar dataKey="missed" fill="#E53E3E" name="Missed" />
            </BarChart>
          </ResponsiveContainer>
        </CardBody>
      </Card>

      {/* Modal for AI Details */}
      <Modal isOpen={isModalOpen} onClose={() => setModalOpen(false)}>
        <ModalOverlay />
        <ModalContent>
          <ModalHeader>AI Agent Performance Details</ModalHeader>
          <ModalCloseButton />
          <ModalBody>
            <Text>Detailed analytics about AI performance can be shown here.</Text>
          </ModalBody>
        </ModalContent>
      </Modal>
    </Box>
  );
};

export default ParticipantsPage;
